import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";
import {
  Button,
  Stack,
  IconButton,
  Divider,
  Card,
  TextField,
} from "@mui/material";
import {
  DirectionsCar,
  BarChart,
  AttachMoney,
  Email,
  Apartment,
  DateRange,
} from "@mui/icons-material";

export default function Main({ name }) {
  let navigate = useNavigate();
  return (
    <div
      style={{
        width: "100vw",
        height: "100vh",
        display: "flex",
        justifyContent: "center",
      }}
    >
      <TextField
        id="outlined-basic"
        label="Outlined"
        variant="outlined"
        style={{ marginTop: "10%", width: "30vw" }}
      />
    </div>
  );
}
